        this.state = {
          count: 0,
        };

        this.test = () => console.log('test');
    }

    test() {
        console.log('test');
    }


    render() {
        return (
            <Tile onClick={this.test} name='dog folder' image='dog' isFolder={true} /> 
        )
    }
}
